import logo from './platzi.webp';
import './App.css';

function App() {
  //JSX
  return (
    <div className="App">
<TodoItem
total={5}
/>

      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edita el archivo <code>src/App.js</code> y guarda para recargar.
        </p>
        <a
          className="App-link"
          href="https://platzi.com/reactjs"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

function TodoItem (pro)
{
  return (
    <li>
       <span>{pro.total}</span>
       <p> hola mundo </p>
       <span>X</span>
    </li>
  );
}

export default App;
